BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "INVOICES" (
	"INVOICE_ID"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"INVOICENUMBER"	integer NOT NULL,
	"CUSTOMERID"	integer,
	"TRANSACTIONDATE"	long,
	"TERMS"	text NOT NULL,
	"NONTAXABLESUB"	numeric(53 , 0),
	"TAXABLESUB"	numeric(53 , 0),
	"TAX"	numeric(53 , 0),
	"GRANDTOTAL"	numeric(53 , 0),
	"AMTPAID"	numeric(53 , 0),
	"DATEPAID"	bigint,
	"STATUS"	bigint
);
CREATE TABLE IF NOT EXISTS "LINEITEMS" (
	"LINEITEM_ID"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"PRODUCTNAME"	text NOT NULL,
	"DESCRIPTION"	text,
	"PRICE"	numeric(53 , 0) NOT NULL,
	"QTY"	numeric(53 , 0) NOT NULL,
	"TOTAL"	numeric(53 , 0) NOT NULL,
	"INVOICEIDNUMBER"	bigint NOT NULL,
	"ISTAXABLE"	bigint NOT NULL
);
CREATE TABLE IF NOT EXISTS "PRODUCTS" (
	"PROD_ID"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"PRODNAME"	text NOT NULL,
	"PRODDESCRIPTION"	text,
	"DATEPURCHASED"	bigint,
	"COST"	numeric(53 , 0) NOT NULL,
	"INVOICEID"	bigint NOT NULL
);
CREATE TABLE IF NOT EXISTS "CUSTOMERS" (
	"CUST_ID"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"CUSTNAME"	varchar(150) NOT NULL,
	"EMAIL"	varchar(150),
	"CONTACT"	varchar(50),
	"ADDRESS"	varchar(150),
	"CITY"	TEXT,
	"STATE"	TEXT,
	"ZIP"	TEXT,
	"TAXABLE"	integer NOT NULL
);
CREATE INDEX IF NOT EXISTS "ReverseInvoicesSort" ON "INVOICES" (
	"INVOICENUMBER"	DESC
);
CREATE UNIQUE INDEX IF NOT EXISTS "Invoices_sqlite_autoindex_Invoices_1" ON "INVOICES" (
	"INVOICE_ID"	ASC
);
CREATE UNIQUE INDEX IF NOT EXISTS "LineItems_sqlite_autoindex_LineItems_detail_1" ON "LINEITEMS" (
	"LINEITEM_ID"	ASC
);
CREATE UNIQUE INDEX IF NOT EXISTS "Products_sqlite_autoindex_Products_1" ON "PRODUCTS" (
	"PROD_ID"	ASC
);
CREATE UNIQUE INDEX IF NOT EXISTS "Customers_sqlite_autoindex_Customers_1" ON "CUSTOMERS" (
	"CUST_ID"	ASC
);
COMMIT;
